import React, { useState } from 'react';
import VehicleDetails from '../components/Owner/VehicleDetails';
import BookAppointment from '../components/Owner/BookAppointment';
import ViewReports from '../components/Owner/ViewReports';
import './OwnerDashboard.css';

const OwnerDashboard: React.FC = () => {
    // New state for report functionality
    const [report, setReport] = useState({
        type: '',
        description: ''
    });
    const [isSubmitted, setIsSubmitted] = useState(false);

    // Mock vehicle registration data (replace with data from your backend/API)
    const [vehicleDetails] = useState({
        plateNumber: 'ABC123XY',
        vehicleType: 'Sedan',
        make: 'Toyota',
        model: 'Camry',
        year: '2020',
        color: 'Silver',
        engineNumber: 'ENG2020XYZ',
        chassisNumber: 'CHS2020ABC',
        registrationDate: '15/03/2021',
        expiryDate: '14/03/2024'
    });

    const handleReportSubmit = (e: React.FormEvent) => {
        e.preventDefault();
        console.log('Report submitted:', report);
        setIsSubmitted(true);
        setTimeout(() => setIsSubmitted(false), 3000);
        setReport({ type: '', description: '' });
    };

    return (
        <div className="owner-dashboard">
            <header className="dashboard-header">
                <h1>Vehicle Owner Dashboard</h1>
                <div className="user-profile">
                    <span className="welcome-message">Welcome back, Owner</span>
                    <div className="avatar">O</div>
                </div>
            </header>

            <div className="dashboard-grid">
                <section className="dashboard-card vehicle-details-section">
                    <h2>My Vehicle Details</h2>
                    <div className="vehicle-details-container">
                        <div className="detail-row">
                            <span className="detail-label">Plate Number:</span>
                            <span className="detail-value">{vehicleDetails.plateNumber}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Vehicle Type:</span>
                            <span className="detail-value">{vehicleDetails.vehicleType}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Make/Model:</span>
                            <span className="detail-value">{vehicleDetails.make} {vehicleDetails.model}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Year:</span>
                            <span className="detail-value">{vehicleDetails.year}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Color:</span>
                            <span className="detail-value">{vehicleDetails.color}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Engine No:</span>
                            <span className="detail-value">{vehicleDetails.engineNumber}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Chassis No:</span>
                            <span className="detail-value">{vehicleDetails.chassisNumber}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Registration Date:</span>
                            <span className="detail-value">{vehicleDetails.registrationDate}</span>
                        </div>
                        <div className="detail-row">
                            <span className="detail-label">Expiry Date:</span>
                            <span className="detail-value">{vehicleDetails.expiryDate}</span>
                        </div>
                    </div>
                </section>

                {/* Rest of your existing code remains unchanged */}
                <section className="dashboard-card appointment-section">
                    <h2>Book Inspection Appointment</h2>
                    <BookAppointment />
                </section>

                <section className="dashboard-card reports-section">
                    <h2>Inspection Reports</h2>
                    <ViewReports />
                </section>

                <section className="dashboard-card report-section">
                    <h2>Make a Report</h2>
                    {isSubmitted ? (
                        <div className="success-message">Report submitted successfully!</div>
                    ) : (
                        <form onSubmit={handleReportSubmit}>
                            {/* Report form remains unchanged */}
                        </form>
                    )}
                </section>
            </div>
        </div>
    );
};

export default OwnerDashboard;
